import {ClubState} from "./reducer";
import {createSelector} from "@ngrx/store";

export interface AppState {
  club: ClubState
}

export const selectFeature = (state: AppState) => state.club;

export const getClubList = createSelector(
  selectFeature,
  (state: ClubState) => state.clubs
)

export interface ClubEntity {
  id: string;
  name: string;
}

export interface ClubModel {
  id: string;
  name: string;
}

import {ClubModel} from "../../domain/models/club.model";
import {createFeature, createReducer, on} from "@ngrx/store";
import * as fromActions from './actions';


export interface ClubState {
  clubs: ClubModel[];
  isLoading: boolean;
  isLoaded: boolean;
  errors: any
}

const initialClubState: ClubState = {
  clubs: [],
  isLoading: false,
  isLoaded: false,
  errors: null,
}

export const clubFeature = createReducer(
  initialClubState,
  on(
    fromActions.fetchClubs,
    (state) => ({ ...state, isLoading: true, isLoaded: false })
  ),
  on(
    fromActions.fetchClubsSuccess,
    (state, { clubs }) => ({ ...state, clubs, isLoading: false, isLoaded: true })
  ),
  on(
    fromActions.fetchClubsFailed,
    (state, { errors }) => ({ ...state, errors, isLoading: false, isLoaded: false })
  ),
)

import { Observable } from 'rxjs';

export interface UseCase<S, T> {
  execute(params: S): Observable<T>;
}

